import React from "react";
function teams(){
    return(
        <div className="team">
         <div className="team_heading">
            <h2>Our Teams</h2>
            </div>
            <div className="team_content"> 
            <div ><img className="team_img" src="" alt="casebook image" /></div>
            
         </div> 
        </div>
    );
}
export default teams;
